import React from "react";
import "./App.css";

function App() {
  const [searchResult, setSearchResult] = React.useState("");
  const [inputText, setInputText] = React.useState("");

  React.useEffect(() => {
    const url = `api.genius.com/artists/?text_format=`;
    const accessToken = process.env.REACT_APP_REACT_GENIUS_API_KEY;

    if (!inputText) {
      return;
    }

    fetch(url, {
      headers: {
        Authorization: "Bearer " + accessToken,
      },
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
      });
  });
  return (
    <div className="App">
      <h1>Hej!</h1>
    </div>
  );
}

export default App;
